import React, { useState } from 'react';
import { Box, Container, Grid, TextField, Button } from '@mui/material';
import { Route, Link, Routes } from 'react-router-dom';
import styled from 'styled-components';
import ResponsiveAppBar from './appBar/navbar';
import SignInForm from './signIn_form/signIn';
//import JoinNowForm from './Join_now_page/joinNowForm';

function JoinNowForm() {
    return (
        <form style={{
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
            justifyContent: 'center',
            width: '100%',
            height: '100%',
        }}>
            <TextField label="Username" variant="outlined" />
            <TextField label="Password" variant="outlined" type="password" />
            <Button variant="contained" color="primary">Join Now</Button>
        </form>
    );
}

const GlassDiv = styled.div`
  position: absolute;
  top: 0;
  left: 0;
  z-index: 2;
  width: 97.7%;
  height: 95%;
  padding: 20px;
  background: rgba(240, 240, 240, 0.4);
  backdrop-filter: blur(6px);
`;

export default function Home() {
    const [joinNowBtnTrigger, setJoinNowBtnTrigger] = useState(false);

    const handleJoinNowClick = () => {
        setJoinNowBtnTrigger(true);
    };

    return (
        <>
            {joinNowBtnTrigger && (
                <GlassDiv>
                    <JoinNowForm />
                </GlassDiv>
            )}
            <Container maxWidth="xl" sx={{ pt: '10px' }}>
                <Box sx={{ width: '80%', mx: 'auto', flexGrow: 1 }}>
                    <Grid container spacing={1}>
                        <Grid item xs={12} md={12}>
                            <ResponsiveAppBar JoinNowCallBack={handleJoinNowClick} />
                        </Grid>
                        <Grid item xs={12} md={12}>
                            <SignInForm />
                            <Routes>
                                <Route path="/joinNow" element={<JoinNowForm />} />
                            </Routes>
                        </Grid>
                    </Grid>
                </Box>
            </Container>
        </>
    );
}
